         On &quot;Let It Enfold You&quot;, Senses Fail delivers a potent
         combination of tuneful pop-punk and thrashing emo-core that
         should appeal to fans of both Sum 41 and New Found Glory. The
         factor that differentiates the New Jersey quintet from many of
         its peers, however, is the band's uncommonly intelligent
         lyrics. Frontman/main songwriter Buddy Nielsen foregoes the
         lost-love-and-broken-hearts themes typical of most emo in favor
         of literary references and existential questions. In fact,
         inspirations for the songs include Hindu religious texts,
         Charles Bukowski, Joseph Campbell, and Taoist philosophy. Lest
         listeners' fear that this is music more suited to a library
         than the mosh pit, the group swathes the words in an energetic
         bed of aggressive, distorted guitars, soaring harmony vocals,
         and stop-start rhythms. An unusual take on the genre, &quot;Let It
         Enfold You&quot; will rock fans' ears while engaging their minds.



